かんたん打ち込み方式　土留めワイド　<br><center><h2>かんたん打ち込み式土留めワイド</h2><table width="600" border="0" cellspacing="0" cellpadding="0"><tr><td><div align="center"><img src="http://image.rakuten.co.jp/matsucame/cabinet/tsu-06/tsu2172-01.jpg"><br><img src="http://image.rakuten.co.jp/matsucame/cabinet/tsu-06/tsu2172-02.jpg"><br><img src="http://image.rakuten.co.jp/matsucame/cabinet/tsu-06/tsu2172-03.jpg"><br><img src="http://image.rakuten.co.jp/matsucame/cabinet/tsu-06/tsu2172-04.jpg"><br></div></td></tr><tr><td>&nbsp;</td></tr><tr><td><p>土留め作業は今までとても大変な作業でした。<br>この打ち込み式のワイド土留めを使えば、重い土袋を使わずに打ち込むだけで、簡単に土留め作業ができ、見た目もすっきり。<br>高さが24.5ｃｍあるので深く打ち込め、土留めに適しています。<BR>土留め以外にも花木スペースの囲いなどにも使用できます。<BR>直線はもちろん、円形・四角で囲むことができるタイプです。<br><br>エッジストッパー　土とめ　土どめ　土の流出を防ぐ</p></td></tr><tr><td>&nbsp;</td></tr><tr><td><table style="font-size:11pt;" width="500" border="1" align="center" cellpadding="1" cellspacing="5"><TR><TD bgColor="#cccccc" width="81" align="center">商品名</TD><TD>かんたん打ち込み式　土留めワイド（6枚入/12枚入）</TD></TR><TR><TD bgColor="#cccccc" width="81" align="center">カラー</TD><TD>ブラック</TD></TR><TR><TD bgColor="#cccccc" width="81" align="center">サイズ</TD><TD>1枚サイズ：高さ245ｍｍ×幅450ｍｍ×厚さ0.9ｍｍ<br><BR>6枚の場合　幅：2.7ｍ　/　12枚の場合　幅：5.4ｍ</TD></TR><TR><TD bgColor="#cccccc" width="81" align="center">材質</TD><TD>ポリプロピレン（タルク含む）</TD></TR><TR><TD bgColor="#cccccc" width="81" align="center">原産国</TD><TD>日本製</TD></TR><TR><TD bgColor="#cccccc" width="81" align="center">備考</TD><TD>梱包状態：ダンボール入り</TD></TR><TR><TD bgColor="#cccccc" width="81" align="center">区分</TD><TD>ガーデニング・園芸</TD></TR><TR><TD bgColor="#cccccc" width="81" align="center">広告文責</TD><TD>株式会社マツムラカメラ　076-242-1122</TD></TR></table></td></tr></table><br><table width="600" border="0" cellspacing="0" cellpadding="0"><tr><td><div align="center"><img src="http://image.rakuten.co.jp/esteyou/cabinet/img-2/pre2.gif"><br><br><img src="http://www.rakuten.ne.jp/gold/matsucame/pic_data/koshihikari.jpg"><br><br><br><font color="#ff0000" size="2">※おまけはお一人様につき１点となります</font><br></div></td></tr></table><b