　【商品説明】
「継ぎ足しセット」を使用すると設置場所に合わせてフラワーアーチのサイズを大きくできます！<br>
<br>
【使用方法】<br>
幅を広げる場合：アーチパイプとアーチパイプの間に継ぎ足して下さい。<br>
高くする場合：パネルとアーチパイプの間に継ぎ足して下さい。（本製品が2セット必要となります。）<br>
<br>
【仕様】<br>
セット内容:パイプ2本、ジョイント2本、アーム1本入<br>
継ぎ足し長さ：約30cm<br>
材質：スチールパイプ樹脂コーティング、ポリプロピレン、スチール、ポリエチレン<br>
備考：商品は継ぎ足しセットのみとなります。フラワーアーチ本体は別売りです。<br><br><br>
【関連キーワード】<br>
